import {GetForecast} from "../services/OpenWeatherMapService";

function WeatherScreen() {
    let message = "";
    GetForecast('Sibiu')
        .then( result => message=result )
        .catch( result => message=result )
    return (
        <>
            <h3>Weather report</h3>
            message
            {/*<p>Country code and City goes here</p>*/}
            {/*<p>General condition goes here</p>*/}
            {/*<p>Min: </p>*/}
            {/*<p>Max: </p>*/}
            {/*<p>Feels like: </p>*/}
            {/*<p>Wind speed: </p>*/}
            {/*<p>Visibility: </p>*/}
        </>
    );
}

//NOTE don't forget to export the function component so it can be imported in another file
export default WeatherScreen;
